import Header from "./Header";
import Footer from "./Footer";
import CreateNote from "./CreateNote";
import Note from "./Note";





const App3=()=>{
    return (
        <>
        <Header/>
        <CreateNote/>
        <Note/>
        <Footer/>
       
        </>

    )
   
    
    
}


export default App3;
